import React, { Component } from 'react'
import Button from 'react-bootstrap/Button';
import './header.css';

class Header extends Component {

    render() {
        const image =`./head1.jpg`;
        const alt = '';
        return (
            <div id="home" className="App-header heroContainer">

                <h1 className="headerTitle">Software development <br/> to help you achieve your goals</h1>
                <div className="headerSubtitle">
                    <p className="subtitle">Turn your ideas into reality</p>
                </div>

                <Button className="contactButton" variant="primary" href='#contact'>
                    Contact
                </Button>

                <div className="imageHero"/>

            </div>
        )
    }
}

export default Header;
